INSERT INTO `spiele` (`s_id`, `s_name`, `s_hersteller`, `s_preis`, `s_text`, `s_bild`) VALUES
(17, 'Minecraft', 'Mojang', 9.99, ' \r\n                        \" \r\n                        \" \r\n                        \" \r\n                        \" \r\n                        \"Jetzt, da Jesse und die Bande den Wither Storm besiegt haben, die Welt gerettet und ganz super berÃ¼hmte Helden geworden sind, ist das Leben ein bisschen mehr...kompliziert. Mit mehr Verantwortlichkeiten und weniger Zeit fÃ¼r Abenteuer begannen alte Freundschaften zu verblassen - zumindest bis Jesses Hand in einem gruseligen Handschuh, der zu einem alten Unterwassertempel gehÃ¶rt, stecken bleibt. Gemeinsam mit alten Kumpels und neuen Kameraden begibt sich Jesse auf eine brandneue Reise mit harten Entscheidungen, guten Zeiten und mindestens einem temperamentvollen Lama.\r\n                    \"\r\n                    \"\r\n                    \"\r\n                    \"\r\n                    \"\r\n                    ', );
INSERT INTO `spiele` (`s_id`, `s_name`, `s_hersteller`, `s_preis`, `s_text`, `s_bild`) VALUES
(18, 'Battlefield 1', 'Dice', 30.00, ' \r\n                        \"Im Herzen dieser Erweiterung liegen vier verschiedene, brandneue und auf dem Vietnam Krieg basierende Mehrspieler-Maps. Jede Map bringt eine neue Spiel-Erfahrung und frische Grafik mit sich, inklusive Besonderheiten wie SchÃ¼tzengraben, Tunnel und dichtem Dschungel, in welchem der Gegner Ãœberraschungsangriffe starten kann. AuÃŸerdem sind 15 klassische Waffen und 6 Fahrzeuge aus der Vietnam-Ã„ra vom ersten Moment an verfÃ¼gbar.\r\n                    \"\r\n                    ', );
