INSERT INTO `spiele` (`s_id`, `s_name`, `s_hersteller`, `s_preis`, `s_text`, `s_bild`) VALUES
(21, 'FINAL FANTASY XI', 'Square Enix', 27.99, ' \r\n                        \"Tauche ein in ein Online-Mehrspieler-RPG, in dem die Spieler dazu herausgefordert werden, eine Reise durch die Welt von Vana\'dielÂ® anzutreten - eine Welt voller Fantasie, Abenteuer und Entdeckergeist.\r\nFolge dem Ruf und schlieÃŸe dich Spielern aus der ganzen Welt an, um zu dem Helden zu werden, den Vana\'diel braucht. Entdecke neue Kreaturen, bahne dir deinen Weg durch wilde LÃ¤nder und bewÃ¤ltige Aufgaben auf deinem abenteuerlichen Weg. \r\n\"\r\n                    ', );
INSERT INTO `spiele` (`s_id`, `s_name`, `s_hersteller`, `s_preis`, `s_text`, `s_bild`) VALUES
(22, 'Black Desert Online', 'Pearl Abyss', 9.99, 'Black Desert Online ist ein Sandbox-MMORPG mit einer gigantischen detaillierten Welt. Erlebt schnelle actionreiche KÃ¤mpfe, jagt wilde Monster und riesige Bosse, schlieÃŸt Euch mit Freunden zusammen und nehmt mit Eurer Gilde an Postenkriegen und epischen Belagerungskriege teil, um Burgen zu erobern und ganze Regionen zu kontrollieren oder aber feilt an Euren Arbeitstalenten, wie zum Beispiel Fischfang, Handel, Verarbeitung, Kochen und vieles mehr!\r\n', );
